import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <form>
            <label>
              Please tell us about yourself:
            </label><br /><br />

            <input id="firstName" type="text" placeholder="First name"></input><br />
            <input id="lastName" type="text" placeholder="Last name"></input><br />
            <input id="age" type="number" placeholder="Age"></input><br />
            <input id="email" type="email" placeholder="Email address"></input><br />

            <label>
              What type of businesses interest you?
            </label><br /><br />

            <ul id="businesses">
              <li><label><input type="checkbox" value="realEstate" class="checkbox" />Real Estate</label></li>
              <li><label><input type="checkbox" value="frachising" class="checkbox" />Franchising</label></li>
            </ul>

            <input type="submit">Submit</input>
          </form>
        </header>
      </div>
    );
  }
}

export default App;
